import React, { useState } from 'react';
import axios from 'axios'; // Importer axios ici

function Register() {
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: '',
    confirmPassword: '',
    dateOfBirth: ''
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    try {
      const response = await axios.post('http://localhost:3001/register', formData); // Utilisation d'axios pour envoyer la requête POST
      
      if (response.status === 200) {
        // Rediriger l'utilisateur vers une page de confirmation ou de connexion
        window.location.href = '/login';
      } else {
        // Gérer les erreurs ou afficher un message d'erreur à l'utilisateur
        console.error('Erreur lors de l\'inscription:', response.statusText);
      }
    } catch (error) {
      console.error('Erreur lors de l\'inscription:', error);
      // Gérer les erreurs ou afficher un message d'erreur à l'utilisateur
    }
  };

  return (
    <div className="register-container">
      <div className="bg-white py-6 sm:py-8 lg:py-12 font-varela">
        <div className="mx-auto max-w-screen-2xl px-4 md:px-8">
          <h2 className="mb-4 text-center text-2xl font-bold text-gray-800 md:mb-8 lg:text-3xl">Register</h2>

          <form className="mx-auto max-w-lg rounded-lg border" onSubmit={handleSubmit}>
            <div className="flex flex-col gap-4 p-4 md:p-8 bg-accent">
              <div className="flex flex-col md:flex-row gap-4">
                <div className="w-full md:w-1/2">
                  <label htmlFor="username" className="mb-2 inline-block text-sm text-gray-800 sm:text-base">Username</label>
                  <input name="username" value={formData.username} onChange={handleChange} className="w-full rounded border bg-gray-50 px-3 py-2 text-gray-800 outline-none ring-indigo-300 transition duration-100 focus:ring" />
                </div>
                <div className="w-full md:w-1/2">
                  <label htmlFor="email" className="mb-2 inline-block text-sm text-gray-800 sm:text-base">Email</label>
                  <input name="email" value={formData.email} onChange={handleChange} className="w-full rounded border bg-gray-50 px-3 py-2 text-gray-800 outline-none ring-indigo-300 transition duration-100 focus:ring" />
                </div>
              </div>

              <div className="flex flex-col md:flex-row gap-4">
                <div className="w-full md:w-1/2">
                  <label htmlFor="password" className="mb-2 inline-block text-sm text-gray-800 sm:text-base">Password</label>
                  <input name="password" type="password" value={formData.password} onChange={handleChange} className="w-full rounded border bg-gray-50 px-3 py-2 text-gray-800 outline-none ring-indigo-300 transition duration-100 focus:ring" />
                </div>
                <div className="w-full md:w-1/2">
                  <label htmlFor="confirmPassword" className="mb-2 inline-block text-sm text-gray-800 sm:text-base">Confirm Password</label>
                  <input name="confirmPassword" type="password" value={formData.confirmPassword} onChange={handleChange} className="w-full rounded border bg-gray-50 px-3 py-2 text-gray-800 outline-none ring-indigo-300 transition duration-100 focus:ring" />
                </div>
              </div>

              <div>
                <label htmlFor="dateOfBirth" className="mb-2 inline-block text-sm text-gray-800 sm:text-base">Date of Birth</label>
                <input name="dateOfBirth" type="date" value={formData.dateOfBirth} onChange={handleChange} className="w-full rounded border bg-gray-50 px-3 py-2 text-gray-800 outline-none ring-indigo-300 transition duration-100 focus:ring" />
              </div>

              <div className="flex items-center">
                <input type="checkbox" className="form-checkbox h-4 w-4 text-indigo-600 transition duration-100 rounded ring-indigo-300" />
                <label htmlFor="terms" className="ml-2 text-gray-700">J'accepte les conditions d'utilisation</label>
              </div>

              <button type="submit" className="block rounded-lg bg-secondary px-8 py-3 text-center text-sm font-semibold text-white outline-none ring-gray-300 transition duration-100 hover:bg-primary focus-visible:ring active:bg-gray-600 md:text-base">Register</button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Register;
